import React, { Component } from 'react';
import { Button } from '@material-ui/core';
import home from './home.png'
import './home.css';


class Home extends Component {
    render() {
        return (
            
                <div >
                    <img src = {home} alt = "Eldery" width = "100%"/>
                    <div className= "center" >
                        <Button variant="contained"  href = "/App">เข้าสู่หน้าจอหลัก</Button>
                    </div>

                </div>
          
        );
    }
}
export default Home;
